import React from "react";

const Skills = () => {
  return (
    <section id="skills">
      <h2>Habilidades</h2>
      <ul>
        <li>React.js</li>
        <li>JavaScript</li>
        <li>CSS / Tailwind</li>
        <li>Node.js</li>
        li
      </ul>
    </section>
  );
};

export default Skills;
